import { Container, Grid, Typography, Card, CardContent, CardMedia, Box } from '@mui/material';

function Team() {
  const teamMembers = [
    {
      name: 'Dr. Sarah Johnson',
      role: 'Founder & CEO',
      image: '/path-to-image.jpg', // You'll need to add actual images
      bio: 'Former residency program director with 15 years of medical education experience.',
    },
    // Add more team members here
  ];

  return (
    <Box sx={{ py: 8 }}>
      <Container>
        <Typography variant="h2" component="h1" textAlign="center" gutterBottom>
          Our Team
        </Typography>
        <Typography variant="h5" textAlign="center" color="text.secondary" sx={{ mb: 8 }}>
          Meet the experts behind Scheduling Wizard
        </Typography>

        <Grid container spacing={{ xs: 2, md: 4 }}>
          {teamMembers.map((member) => (
            <Grid item xs={12} sm={6} md={4} key={member.name}>
              <Card sx={{
                height: '100%',
                display: 'flex',
                flexDirection: 'column',
                transition: 'transform 0.2s',
                '&:hover': {
                  transform: 'translateY(-4px)'
                }
              }}>
                <CardMedia
                  component="img"
                  height={{ xs: 200, sm: 250, md: 300 }}
                  image={member.image}
                  alt={member.name}
                  sx={{
                    objectFit: 'cover',
                    borderBottom: '1px solid rgba(0, 0, 0, 0.12)'
                  }}
                />
                <CardContent>
                  <Typography variant="h5" gutterBottom>
                    {member.name}
                  </Typography>
                  <Typography variant="subtitle1" color="text.secondary" gutterBottom>
                    {member.role}
                  </Typography>
                  <Typography variant="body2">
                    {member.bio}
                  </Typography>
                </CardContent>
              </Card>
            </Grid>
          ))}
        </Grid>
      </Container>
    </Box>
  );
}

export default Team;
